import styled from 'styled-components'

export const Totop_div = styled.div`
position:relative;
height:1000px;
width:80%;
.elevator{
    position: absolute;
    top: -250px;
    left: 50%;
    margin-left: 800px;
    -webkit-transition: -webkit-transform .5s ease;
    transition: -webkit-transform .5s ease;
    transition: transform .5s ease;
    transition: transform .5s ease,-webkit-transform .5s ease;
    z-index: 100;
}
.elevator_list{
  overflow: hidden;
 }
 .elevator_lk{
  position: relative;
    display: block;
    width: 38px;
    height: 38px;
    line-height: 19px;
    font-size: 14px;
    color: #333;
    padding: 10px;
    text-align: center;
    -webkit-transition: color .2s ease;
    transition: color .2s ease;
    background: red;
    z-index: 1;
 }
`
